INSERT INTO `product` (`id_product`, `product_name`, `price`, `brand`, `description`, `colour`, `mpx`, `product_type`, `img`) VALUES
(1, 'Canon EOS 1300D', '385.000', 'Canon', 'Cattura i momenti migliori con la tua EOS 1300D da 18 megapixel e inizia a condividere foto di qualit√† reflex e filmati Full HD in stile cinematografico. Da uno spettacolare tramonto a una matrimonio estivo, distinguiti dagli altri con una fotocamera che ti consente di condividere immediatamente le tue storie di vita tramite Wi-Fi e NFC*.', 'Black', '18.000', 'Reflex', );
INSERT INTO `product` (`id_product`, `product_name`, `price`, `brand`, `description`, `colour`, `mpx`, `product_type`, `img`) VALUES
(2, 'Canon EOS 800D', '499.990', 'Canon', ' Scattare fantastiche foto non √® mai stato cos√¨ semplice. Canon EOS 800D √® dotata di tecnologie di facile utilizzo, per farti realizzare foto eccezionali con funzioni come l\'avanzata messa a fuoco automatica e il controllo wireless dal tuo telefono. Inoltre, il compatto obiettivo zoom EF-S 18-55 mm f/4-5.6 IS STM occupa uno spazio talmente ridotto che non potrai pi√π fare a meno della tua fotocamera. Ideale per qualsiasi tipo di foto, dai ritratti ai paesaggi, accessorio eccezionale per i viaggi.', 'Black', '24.400', 'Reflex', NULL),
(3, 'Canon EOS 4000D', '417.000', 'Canon', ' Racconta storie uniche con la fotografia. Questa reflex per principianti con obiettivo EF-S 18-55mm f/3.5-5.6 III e controllo manuale fotografico parziale o completo consente di creare in modo intuitivo foto eccezionali e filmati Full HD ricchi di dettagli e colori. Grazie al sensore APS-C da 18 megapixel, puoi scattare in condizioni di scarsa illuminazione ed esprimere la tua creativit√† con gli obiettivi intercambiabili. Inquadra e scatta con Scene Intelligent Auto e condividi le tue storie tramite il Wi-Fi¬π di EOS 4000D e l\'app Camera Connect.', 'Black', '18.000', 'Reflex', NULL),
(4, 'Canon EOS 80D', '1239.000', 'Canon', 'A casa o in viaggio, di giorno o di notte, esplora l\'arte della realizzazione di foto e filmati con una fotocamera completa, veloce e affidabile che ti consente di ottenere foto e video Full HD incredibili. Cogli anche i momenti pi√π sfuggenti grazie ai controlli intuitivi, alla velocit√† di scatto di 7fps e alla risoluzione piena di 24,2 MP. Condividi i tuoi ultimissimi scatti di paesaggi o ritratti tramite Wi-Fi e NFC*.', 'Black', '24.200', 'Reflex', NULL),
(5, 'Canon EOS 5D Mark IV', '3759.880', 'Canon', 'La qualit√† dell\'immagine risulter√† sempre altissima, a prescindere dal soggetto ripreso. Dai reportage ai ritratti, dalla street photography ai paesaggi nella luce della sera, EOS 5D Mark IV catturer√† qualsiasi dettaglio, anche ad alto contrasto. I video 4K garantiscono nuovi livelli di prestazioni. Lo scatto continuo a 7 fps aiuta a catturare il momento perfetto, mentre il GPS tiene traccia degli spostamenti. Le tecnologie Wi-Fi e NFC semplificano e velocizzano il controllo wireless e la condivisione di immagini. Aumenta la flessibilit√† in post produzione con l\'aggiornamento a Canon Log incluso. Canon Log offre una gamma dinamica maggiormente ampia e ti consente di mantenere dettagli dall\'aspetto naturale. Ti permette inoltre un colour grading pi√π semplice per ridurre la rumorosit√† in post produzione e ottenere riprese di filmati con l\'aspetto patinato che cercavi.', 'Black', '30.400', 'Reflex', NULL),
(6, 'Canon EOS 6D Mark II', '2089.000', 'Canon', 'La fotocamera EOS 6D Mark II utilizza un sensore full-frame da 26.2 megapixel per offrire una qualit√† dell\'immagine superiore, maggiore controllo sulla profondit√† di campo e migliori prestazioni in condizioni di scarsa illuminazione. √à eccezionale per i ritratti, grazie allo scatto continuo a 6,5 fps che consente di catturare le espressioni pi√π fuggevoli. Il design compatto di EOS 6D Mark II la rende la scelta ideale per i paesaggi, i viaggi e anche le foto di reportage.', 'Black', '26.200', 'Reflex', NULL),
(7, 'Canon EOS 200D', '679.000', 'Canon', 'La reflex digitale pi√π leggera al mondo con schermo orientabile¬π: EOS 200D √® una scelta eccezionale per paesaggi, ritratti e viaggi, per realizzare foto e filmati di qualit√† eccellente grazie a un sensore di nuova generazione da 24.2 megapixel. √à inoltre dotata di connessione, progettata per integrarsi perfettamente con smartphone e tablet¬≤. L\'obiettivo zoom EF-S 18-55mm f/4-5.6 IS STM incluso (in colore argento) √® una soluzione versatile per gli scatti di ogni giorno a persone e luoghi, e il design compatto e leggero lo rende ideale anche per i viaggi.', 'Silver', '24.200', 'Reflex', NULL),
(8, 'Olympus E-M1 Mark II', '1799.000', 'Olympus', 'L\'E-M1 Mark II si distingue da tutte le OM-D che l\'hanno preceduta. Un concentrato di tecnologica che offre un\'esperienza fotografica ottimale a tutti i professionisti: un sistema AF evoluto con ripresa sequenziale ad alta velocit√†: Autofocus continuo (C-AF) fino a 18 fps e Autofocus singolo (S-AF) fino a 60 fps. L\'innovativo Pro Capture inoltre permette di scattare fotografie in tempo reale. Una batteria leggera, impermeabile e con elevata durata. Sensore 20M Live MOS e processore TruePic VIII per nuovi livelli di qualit√† delle immagini. Non si pu√≤ desiderare altro.', 'Black', '20.400', 'Reflex', NULL),
(9, 'Nikon D7500', '1469.800', 'Nikon', 'NIKON D7500+TAMRON 18-200/3,5-6,3 II VC. La D7500 proposta in kit con il TAMRON 18-200/3,5-6,3 DI II VC assicura foto nitide e ad alta definizione con ricche gradazioni tonali. Potrete avvantaggiarvi di un riconoscimento del soggetto incredibilmente accurato e di prestazioni superiori a ISO elevate. Sarete stupiti dalla qualit√† delle sequenze video 4K/UHD. E il sistema Picture Control 2.0 vi consente di applicare con facilit√† il vostro stile creativo personale se riprendete foto o video.. Eccellente in condizioni di luce debole. Con una sensibilit√† ISO 100-51200 espandibile fino a ISO 1640000 (equivalente), la D7500 non ha paura del buio.. Il veloce processore di elaborazione EXPEED 5 assicura un\'eccezionale qualit√† delle foto su tutta la gamma ISO. I disturbi fini sono drasticamente ridotti e persino le foto ritagliate scattate con valori ISO elevati mantengono la propria qualit√†. L\'impostazione Hi 5 consente riprese a un incredibile ISO 1640000 (equivalente) per approfittare al massimo della luce disponibile.', 'Black', '20.900', 'Reflex', NULL);
INSERT INTO `product` (`id_product`, `product_name`, `price`, `brand`, `description`, `colour`, `mpx`, `product_type`, `img`) VALUES
(10, 'Leica Q', '4290.000', 'Leica', 'IL MASSIMO DELLE PERFORMANCE, NEL PIU\' CLASSICO STILE LEICA. La compagna perfetta degli street photographer? La Leica Q. E quella degli street photographer pi√π alla moda? La Leica Q Silver', 'Black', '24.000', 'Reflex', );
INSERT INTO `product` (`id_product`, `product_name`, `price`, `brand`, `description`, `colour`, `mpx`, `product_type`, `img`) VALUES
(11, 'Nikon D850', '4589.800', 'Nikon', 'NIKON D850+AF-S 24-120/4 G ED VR. Il sensore in formato FX ad altissima risoluzione della D850 utilizza 45,7 megapixel di risoluzione effettiva per garantire file da 45,4 MP riccamente dettagliati. Stampa immagini ad altissima risoluzione in formati eccezionalmente grandi. Acquisisci filmati autentici a pieno fotogramma 4K. Il sensore retroilluminato CMOS √® privo di filtro passa-basso ottico e incorpora micro-lenti su chip senza interruzioni e rivestimento antiriflesso. La luce in entrata raggiunge i fotodiodi in maniera pi√π efficiente, in modo tale che tu possa acquisire dettagli eccezionali, nonch√© una gamma dinamica. In aggiunta, il sistema AF a 153 punti, ereditato dalla D5, garantisce immagini sempre nitide e l\'ampia copertura necessaria per immagini a pieno formato ad altissima risoluzione.. . La velocit√† ha questo aspetto nei file da 45,4 MP: Rivela quei secondi essenzialmente importanti con la combinazione definitiva di potenza e durata. La D850 scatta a 7fps. Tuttavia, √® possibile anche scattare a 9 fps quando utilizzi la Multi-Power Battery Pack MB-D18 opzionale con inserita la batteria EN-EL18B (usata per la D5). Puoi ottenere immagini a piena risoluzione, anche quando acquisisci in formato RAW. Inoltre, la batteria della D5 consente fino a 1840 scatti con una sola carica (in modo di scatto a fotogramma singolo, secondo gli standard CIPA). Un processore AF dedicato assicura uno strepitoso riconoscimento del soggetto quando scatti un elevato numero di fotogrammi al secondo: persino i movimenti ad alta velocit√† dei soggetti pi√π minuti in condizioni di scarsa illuminazione possono essere individuati con una precisione degna di nota.', 'Black', '45.700', 'Reflex', NULL),
(12, 'Leica S', '19070.000', 'Leica', 'Questa fotocamera di medio formato offre fantastica facilit√† operativa, eccezionale robustezza, ottima qualit√† d\'immagine e perfetto abbinamento di tutti i suoi componenti. Realizzato sulle precise necessit√† dei fotografi professionisti.', 'Black', '37.000', 'Reflex', NULL),
(13, 'Nikon D5600', '989.800', 'Nikon', 'NIKON D5600+AF-S 18-140 VR KIT BOX. La Nikon D5600 √® una reflex digitale di Nikonin formato DX che estende la gamma di fotocamere dotate di SnapBridge, dedicata a chi desidera esplorare le infinite opportunit√† creative che la fotografia offre: dai giochi d\'ombra sotto il sole ai filmati ripresi da prospettive insolite, nessuna scena sar√† preclusa a chi utilizza questa nuova Nikon.. La qualit√† dell\'immagine √® tutto e l\'ampio sensore d¬íimmagine in formato DX da 24,2 megapixel della D5600 consente di catturare anche i dettagli pi√π fini e di ottenere foto e filmati incredibilmente nitidi. . La sensibilit√† ISO da 100 a 25.600, garantisce una facile gestione di tutte le scene, anche quelle caratterizzate da condizioni d¬íilluminazione scarsa o problematica. . Grazie a Nikon SnapBridge, poi, gli utenti possono sincronizzare automaticamente la fotocamera con il proprio smart device e condividere istantaneamente gli scatti realizzati. SnapBridge, inoltre, consente di utilizzare lo smart device connesso per scattare in remoto grazie al modulo Wi-Fi¬Æ integrato nella fotocamera. . Durante le riprese con il mirino, la perfezionata funzione Fn touch rappresenta un\'alternativa intuitiva all\'utilizzo della ghiera di comando o del multi-selettore: con essa, infatti, i fotografi possono azionare il controllo Sensibilit√† automatica, nonch√© selezionare il punto AF o regolare altre importanti impostazioni dall\'ampio schermo touchscreen. La barra di avanzamento dei fotogrammi, ereditata dalle fotocamere professionali Nikon D5 e D500, consente di scorrere rapidamente le immagini realizzate mentre, per chi riprende filmati, la nuova funzione Ripresa time-lapse (ereditata dalle Reflex digitali Nikon di fascia alta) trasforma con facilit√† le scene in lento movimento in sequenze ad alta velocit√† di forte impatto.', 'Black', '24.200', 'Reflex', NULL),
(14, 'Nikon D7100', '1069.800', 'Nikon', 'NIKON DSLR D7100 in kit con il nuovo obiettivo NIKKOR AF-S 18-140/3,5-5,6 G ED VR DX :Versatile obiettivo zoom 7,8x in formato DX dotato del sistema Riduzione Vibrazioni di Nikon a dalle prestazioni ottiche elevate: la lente in vetro ED (a bassissimo indice di dispersione) e la lente asferica garantiscono elevati valori di risoluzione e contrasto, riducendo al minimo l\'aberrazione e la dispersione del colore.Compatto e versatile, √® perfetto per una grande variet√† di soggetti e la sua leggerezza lo indica come compagno ideale ALL-in-One.. Vero e proprio concentrato di competenze e di alta precisione, la Nikon D7100 offre prestazioni degne di un\'apparecchio professionale.. La sua struttura ottica di alta qualit√† si fonda su un sensore CMOS nel formato DX di 24,1 milioni di pixel e su un sistema AF di 51 punti. L\'immagine prodotta beneficia non solo dell\'alta sensibilit√† ISO della D7100, ma anche del trattamento ultra veloce garantito dal processore Expeed 3.. Non utilizzando un filtro ottico passa-basso, la D7100 ottimizza la resa del suo sensore CMOS per acquisire con la massima nitidezza e una risoluzione particolarmente elevata anche i pi√π piccoli dettagli.. Ben equipaggiata, la D7100 √® una reflex digitale capace di scattare fino a 6 foto in modalit√† bracketing, catturare i dettagli cromatici pi√π sottili, e filmare sequenze video mozzafiato in qualit√† Full HD.. La sua maneggevolezza e la sua ergonomia sono ottimizzate in maniera intelligente, proponendo da un lato una connettivit√† particolarmente pratica (USB, HDMI, mini stereo 3,5 mm) e dall\'altra un doppio sistema di inquadratura: tramite il mirino BriteView o direttamente dal display di 3,2\".. A prova di polvere e di intemperie, la D7100 beneficia di un corpo macchina in magnesio interamente tropicalizzato. ', 'Black', '24.100', 'Reflex', NULL),
(15, 'Nikon D810', '3900.000', 'Nikon', 'La reflex pieno formato Nikon D810 incorpora il nuovissimo sensore formato FX, l\'esteso intervallo di sensibilit√† ISO e il processore di elaborazione delle immagini Nikon EXPEED 4 assicurano nitidezza, ricche tonalit√† e disturbo contenuto in ogni condizione.   in kit con obiettivo NIKKOR AF-S 24-120/4 G ED VR : Obiettivo zoom 5x compatto e versatile progettato per l\'utilizzo con le fotocamere reflex digitali Nikon formato FX. Offre prestazioni ottiche elevate, apertura costante di f/4 e versatile escursione focale di 24-120 mm.', 'Black', '36.300', 'Reflex', NULL),
(16, 'Leica Lumix G9', '2289.800', 'Panasonic', 'PANASONIC LUMIX G9+LEICA 12-60/2,8-4 (DC-G9L). PANASONIC LUMIX G9 in kit con il prestigioso zoom standard LEICA DG VARIO-ELMARIT F2.8-4.0 Asph. Power OIS.Panasonic ha adottato un approccio diverso allo sviluppo delle telecamere con la fotocamera mirrorless Micro Four Thirds DC-G9 , che ha una variet√† di funzioni e caratteristiche appena sviluppate che piaceranno ai fotografi. Il punto centrale del processo di imaging √® la combinazione di un sensore Live MOS da 20,3 MP e dell\'ultimo processore Venus Engine, che consente di acquisire immagini nitide e video con sensibilit√† fino a ISO 25600.. Sensore MOS Live Digital da 20,3 MP e Venus Engine. Ottimizzato per l\'imaging ad alta velocit√† ad alta velocit√†, il G9 √® dotato sia di un sensore Micro MOS fino a quattro terzi MOS da 20,3 MP che di un processore Venus potenziato per creare immagini nitide e dettagliate e video UHD 4K. Questa configurazione ottimizza la risoluzione riducendo al minimo il rumore, consentendo l\'uso di sensibilit√† fino a ISO 25600. √à anche molto veloce, consentendo velocit√† di scatto continuo fino a 60 fps con AF-S e 20 fps con AF-C quando si utilizza il Otturatore elettronico G9 o 12 fps per AF-S e 9 fps per AF-C utilizzando l\'otturatore meccanico. La Natura in tutta la sua bellezza.', 'Black', '20.300', 'Reflex', NULL),
(17, 'Canon EOS-1D X Mark II', '6459.990', 'Canon', 'In studio o sul campo, in tribuna o nel cuore dell\'azione, cattura il momento con la fotocamera EOS-1D X Mark II da 20,2 MP. Se desideri una messa a fuoco velocissima e precisa, una qualit√† dell\'immagine con latitudine elevata, livelli incredibili di dettaglio e nitidezza in condizioni di scarsa illuminazione e filmati 4K, scegli una fotocamera che non ti deluder√† mai. Ovunque ti trovi, non perdere mai nemmeno uno scatto.', 'Black', '20.000', 'Reflex', NULL),
(18, 'Canon EOS 5DS R', '4189.000', 'Canon', 'La migliore qualit√† reflex, con una risoluzione di 50,6 megapixel e un filtro per l\'annullamento dell\'effetto passa-basso che ottimizza la nitidezza del sensore della fotocamera.', 'Black', '50.000', 'Reflex', NULL);

